import React from "react";
import Input from "../Input";

function HeadColumn({value, id, onchange, dataAttr}) {
    console.log('value', value)
    return(
        <th key={id}>
            <p>{value}</p>
            <Input onChange={onchange} dataAttr={'userId'}/>
        </th>
    )
}

export default HeadColumn
